#
# Azure Demo Apps
# 
# 1. Validate and Initialize
# 2. Create Cake Website
# 3. Create Quilt Website
#

# 1. Validate and Initialize
# Variable Initialization
$SubID       = "27cafca8-b9a4-4264-b399-45d0c9cca1ab"
$ShortRegion = "westus2"
$CakeRGName  = "DemoCake"
$QuiltRGName = "DemoQuilt"

# Start nicely
Write-Host
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Starting Demo App Deployment, estimated total time 5 minutes" -ForegroundColor Cyan

# Set Subscription and Login
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Setting Subscription Context" -ForegroundColor Cyan
Try {$myContext = Set-AzContext -Subscription $SubID -ErrorAction Stop}
Catch {Write-Warning "Permission check failed, ensure Sub ID is set correctly!"
       Return}
Write-Host "  Current Sub:",$myContext.Subscription.Name,"(",$myContext.Subscription.Id,")"
Write-Host "  Current User: ",$myContext.Account.Id

# 2. Create Cake Website
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Creating Cake Resource Group $CakeRGName" -ForegroundColor Cyan
Try {Get-AzResourceGroup -Name $CakeRGName -ErrorAction Stop | Out-Null
        Write-Host "  Resource group exists, skipping"}
Catch {New-AzResourceGroup -Name $CakeRGName -Location $ShortRegion | Out-Null}

# Create Web App and compress
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Creating Web page and Web.Config file" -ForegroundColor Cyan
$WebDir = "$HOME/wwwroot"
If (-Not (Test-Path -Path $WebDir)){
    New-Item $WebDir -ItemType Directory | Out-Null}
else {
    Remove-Item -Path $WebDir\* -Recurse
}

# Create Web App Pages
# PowerShell 7
# [convert]::ToBase64String((get-content .\cakebakery.jpg -AsByteStream -Raw))
# PowerShell 5
# [convert]::ToBase64String((get-content .\cakebakery.jpg -Encoding Byte))
$CakeImage= @'

'@

$MainPage = '<!DOCTYPE html>
<html xmlns=http://www.w3.org/1999/xhtml>
<head runat="server">
  <title>Sandy''s Bundt Cake Bakery</title>
</head>
<body style="font-family: Optima,Segoe,Segoe UI,Candara,Calibri,Arial,sans-serif;">
  <form id="frmMain" runat="server">
    <div>
      <h1>Sandy''s Bundt Cake Bakery!</h1>
      This is a page from the inside (a web server on a private network),<br /><br />
      <br />
      The following sections show:
      <ul style="margin-top: 0px;">
        <li> Local Server Time - Shows if this page is or isnt cached anywhere</li>
      </ul>
      <div style="border: 2px solid #8AC007; border-radius: 25px; padding: 20px; margin: 10px; width: 650px;">
        <b>Serving from Server</b>: <asp:Label runat="server" ID="lblName" /></div>
      <div style="border: 2px solid #8AC007; border-radius: 25px; padding: 20px; margin: 10px; width: 650px;">
        <b>Local Web Server Time</b>: <asp:Label runat="server" ID="lblTime" /></div>
      <div style="border: 2px solid #8AC007; border-radius: 25px; padding: 20px; margin: 10px; width: 650px;">
        <b>Image File Linked from the Internet</b>:<br />
        <br />
        <img src=cakebakery.jpg alt="Featuring big and bite-sized cakes!" width="150" length="175"/></div>
    </div>
  </form>
</body>
</html>'

$WebConfig ='<?xml version="1.0" encoding="utf-8"?>
<configuration>
  <system.web>
    <compilation debug="true" strict="false" explicit="true" targetFramework="4.8" />
    <httpRuntime targetFramework="4.8" />
    <customErrors mode="Off"/>
  </system.web>
</configuration>'

$MainPage | Out-File -FilePath "$WebDir\default.aspx" -Encoding ascii
if ($PSVersionTable.PSVersion.Major -eq 5) {[System.Convert]::FromBase64String($CakeImage) | Set-Content "$WebDir\cakebakery.jpg" -Encoding Byte | Out-Null}
else {[System.Convert]::FromBase64String($CakeImage) | Set-Content "$WebDir\cakebakery.jpg" -AsByteStream | Out-Null}
$WebConfig | Out-File -FilePath "$WebDir\web.config" -Encoding ascii

# Compress files for upload to App Service
Compress-Archive -Path $WebDir/* -DestinationPath $WebDir/wwwroot.zip -Force

# Create App Service
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Creating App Service" -ForegroundColor Cyan
# Create a web app
try {Get-AzWebApp -ResourceGroupName $CakeRGName -Name $CakeRGName-app  -ErrorAction Stop | Out-Null
     Write-Host "  App Service exists, skipping"}
catch {New-AzWebApp -ResourceGroupName $CakeRGName -Location $ShortRegion -Name $CakeRGName-app -AppServicePlan $CakeRGName-app-plan | Out-Null}

# Publish the web app
Publish-AzWebApp -ResourceGroupName $CakeRGName -Name $CakeRGName-app -ArchivePath $WebDir/wwwroot.zip -Force | Out-Null

# 3. Create Quilt Website
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Creating Quilt Resource Group $QuiltRGName" -ForegroundColor Cyan
Try {Get-AzResourceGroup -Name $QuiltRGName -ErrorAction Stop | Out-Null
     Write-Host "  Resource group exists, skipping"}
Catch {New-AzResourceGroup -Name $QuiltRGName -Location $ShortRegion | Out-Null}

# Create Web App and compress
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Creating Web page and Web.Config file" -ForegroundColor Cyan
$WebDir = "$HOME/wwwroot"
If (-Not (Test-Path -Path $WebDir)){
    New-Item $WebDir -ItemType Directory | Out-Null}
else {
    Remove-Item -Path $WebDir\* -Recurse
}

# Create Web App Pages
# PowerShell 7
# [convert]::ToBase64String((get-content .\quilts.jpg -AsByteStream -Raw))
# PowerShell 5
# [convert]::ToBase64String((get-content .\quilts.jpg -Encoding Byte))
$QuiltImage = @'

'@

$MainPage = '<!DOCTYPE html>
<html xmlns=http://www.w3.org/1999/xhtml>
<head runat="server">
  <title>Amy''s Custom Quilts</title>
</head>
<body style="font-family: Optima,Segoe,Segoe UI,Candara,Calibri,Arial,sans-serif;">
  <form id="frmMain" runat="server">
    <div>
      <h1>Amy''s Custom Quilts!</h1>
      This is a page from the inside (a web server on a private network),<br /><br />
      <br />
      The following sections show:
      <ul style="margin-top: 0px;">
        <li> Local Server Time - Shows if this page is or isnt cached anywhere</li>
      </ul>
      <div style="border: 2px solid #8AC007; border-radius: 25px; padding: 20px; margin: 10px; width: 650px;">
        <b>Serving from Server</b>: <asp:Label runat="server" ID="lblName" /></div>
      <div style="border: 2px solid #8AC007; border-radius: 25px; padding: 20px; margin: 10px; width: 650px;">
        <b>Local Web Server Time</b>: <asp:Label runat="server" ID="lblTime" /></div>
      <div style="border: 2px solid #8AC007; border-radius: 25px; padding: 20px; margin: 10px; width: 650px;">
        <b>Image File Linked from the Internet</b>:<br />
        <br />
        <img src=quilts.jpg alt="Featuring big and bite-sized cakes!" width="150" length="175"/></div>
    </div>
  </form>
</body>
</html>'

$WebConfig ='<?xml version="1.0" encoding="utf-8"?>
<configuration>
  <system.web>
    <compilation debug="true" strict="false" explicit="true" targetFramework="4.8" />
    <httpRuntime targetFramework="4.8" />
    <customErrors mode="Off"/>
  </system.web>
</configuration>'

$MainPage | Out-File -FilePath "$WebDir\default.aspx" -Encoding ascii
if ($PSVersionTable.PSVersion.Major -eq 5) {[System.Convert]::FromBase64String($CakeImage) | Set-Content "$WebDir\quilts.jpg" -Encoding Byte | Out-Null}
else {[System.Convert]::FromBase64String($CakeImage) | Set-Content "$WebDir\quilts.jpg" -AsByteStream | Out-Null}
$WebConfig | Out-File -FilePath "$WebDir\web.config" -Encoding ascii

# Compress files for upload to App Service
Compress-Archive -Path $WebDir/* -DestinationPath $WebDir/wwwroot.zip -Force

# 8.5 Create App Service
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Creating App Service" -ForegroundColor Cyan

# Create a web app
try {Get-AzWebApp -ResourceGroupName $QuiltRGName -Name $QuiltRGName-app -ErrorAction Stop | Out-Null
     Write-Host "  App Service exists, skipping"}
catch {New-AzWebApp -ResourceGroupName $QuiltRGName -Location $ShortRegion -Name $QuiltRGName-app -AppServicePlan $QuiltRGName-app-plan | Out-Null}

# Publish the web app
Publish-AzWebApp -ResourceGroupName $QuiltRGName -Name $QuiltRGName-app -ArchivePath $WebDir/wwwroot.zip -Force | Out-Null

# End Nicely
Write-Host (Get-Date)' - ' -NoNewline
Write-Host "Demo Apps completed successfully" -ForegroundColor Green
Write-Host "  All environment components are built, time to play!" -ForegroundColor Green
Write-Host
